<div class="elementor-text-editor elementor-clearfix">
<p><strong>Tracking:</strong></p>
<p>Tracking will be given to you same day after purchase and can be found in your receipt and in the confirmation email you will receive.</p>
<div align="left">
<p><strong>Physical shipment:</strong></p>
<p>Most of the vendors will ship package within 1 hour of receiving notification about payment into Escrow. DHL &amp; UPS ship Monday-Friday and not during holidays. Vendors will ship with FEDEX Mon-Sat and any other delivery service you will mention during checkout process. You can ask for any if you want any special. FEDEX, DHL, UPS, MAIL packages will be mailed the same day.</p>
</div>
<div align="left"><strong>Packaging &amp; Labeling:</strong></div>
</div>
</div>
</div>
</div>
</div>
</div>
<div class="elementor-element elementor-element-f231454 elementor-column elementor-col-50 elementor-top-column" data-id="f231454" data-element_type="column">
